import React from 'react';

const TreasureChest = ({ title, content }) => (
  <div className="treasure-chest">
    <h3>{title}</h3>
    <div className="chest">
      <div className="chest-lid"></div>
      <div className="chest-body"></div>
    </div>
    <p>{content}</p>
  </div>
);

export default TreasureChest;
